import { StyleSheet } from 'react-native';
import colors from '../../config/colors';

const styles = StyleSheet.create({
  input: {
    width: 300,
    height: 40,
    backgroundColor: 'white',
    borderRadius: 10,
    marginBottom: 10,
    paddingHorizontal: 10,
    borderColor: colors.primary,
    borderWidth: 1,
    flexDirection: 'row',
  },
  logo: {
    
  },
});

export default styles;
